  console.log(isMenu);

  function handleClick_2() {
    setIsMenu(false);
  }
  if (isMenu == true) {
    return (
      <del className="menu_wrapper">
        <div
          onClick={() => {
            handleClick_2();
          }}
          className="menu"
        >
          отметить как "избранное"
        </div>
        <div>удалить из базы навсегда</div>
      </del>
    );
  }
}

export default Menu;
